import React from 'react'
import styled from 'styled-components'
const TokenStyled = styled.div `

width: 130px;
height: 130px;
border: 15px solid red;
box-sizing: border-box;
border-radius: 50%;
display: flex; 
justify-content: center;
align-items: center;
background: white;
box-shadow: 0 5px 0px red;
.box{
   box-shadow: 0 -5px 0 red;
   flex: 1;
   border-radius: 50%;
}
`




export default function Token({name}) {
    return (
        <TokenStyled>

            <div className="box"><img src={`./images/icon-${name}.svg`} alt=""/></div>
    

        </TokenStyled>
    )
}
